const getBreeds = async () => {
    const url = "http://localhost:8000/showAPI";
    const res = await fetch(url);
    const [ data ] = await res.json();

    const { url_image: image } = data;

    const dog = {
			image: image,
			breed: {
				id: 1,
				name: "Labrador",
			},
		};

    return data
}

export default getBreeds
